import Navbar from "../components/NavBar";
import SignUp from "../components/SignUp";
import SignUpForm from "../components/SignUpForm";



export default function MobileSignUp(){
    return (
        <div>
            <Navbar/>
            <SignUp><SignUpForm/></SignUp>
        </div>
    );
}
